import React, { Component, Img } from 'react';
import { Menu, Icon, Item } from 'antd';

class DivBar extends Component {
  state = {
    current: 'twitter'
  }
  handleClick (e) {
    this.setState({
      current: e.key
    })
  }
  render() {
    return  (
        <Menu
        onClick={this.handleClick}
        selectedKeys={[this.state.current]}
        mode="horizontal">
        <Menu.Item key='twitter'>
          <Icon type='twitter'/> Twitter
        </Menu.Item>
        <Menu.Item key='github'>
          <Icon type='github'/> github
        </Menu.Item>
      </Menu>
    )
  }
}

export default DivBar;
